import React from "react"
import "./styling/ExpenseItem.css"
export default function ExpenseItem() {
    const expenseDate = new Date(2022, 8, 21)
    const expenseTitle = "Car Insruance"
    const expenseAmount = 234.65
    const expenses = [
        {
            id: 'e1',
            title: 'Toilet Paper',
            amount: 94.12,
            date: new Date(2020, 7, 14),
        },
        { 
            id: 'e2', 
            title: 'New TV', 
            amount: 799.49, 
            date: new Date(2021, 2, 12) 
        },
        {
            id: 'e3',
            title: 'Car Insurance',
            amount: 294.67,
            date: new Date(2021, 2, 28),
        },
        {
            id: 'e4',
            title: 'New Desk (Wooden)',
            amount: 450,
            date: new Date(2021, 5, 12),
        },
    ];
    return (
        <div className="expense-item">
            <div>{expenseDate.toISOString()}</div>
            <div>
                <h2 class="expense-item--description">{expenseTitle}</h2>
                <div className="expense-item--price">${expenseAmount}</div>   
            </div>
        </div>
    )
}
